import logo from './logo.svg';
import './App.css';
import SearchBar from './components/search'
import React from "react"; 

function App() {
  return (

    <div className="App">
      <header className="App-header">
        <div className="HeaderStyle">
          <h1>Country Search</h1>
        </div>
        <SearchBar/>
      </header>
      <div className="App-body">
      </div>
    </div>
  );
}
export default App;
